import React, { Component } from 'react';
import PropTypes from 'prop-types';


export class Item extends Component {
  render() {
	return (
	  <div>
		<p>{ this.props.item.name }</p>
	  </div>
	)
  }
}

Item.propTypes = {
	item: PropTypes.object.isRequired
}

export default Item
